import React from "react";
import parse from "html-react-parser";

const ProductItem = (props) => {
    const { product } = props;
    const radio = product.modifiers[1];
    const input = product.modifiers[0];

    console.log(radio,input);

    return (
        <form className=" bg-slate-400 mt-5">
            <div>{product.name}</div>
            <div>{product.price}</div>
            <div>{parse(product.description)}</div>

            <img
                src={product.primary_image.url_standard}
                alt={product.primary_image.description}
                width="100"
                height="200"
            />
            <input
                type={product.modifiers.type}
                id={product.modifiers.id}
                name={product.modifiers.name}
                placeholder={product.modifiers.display_name}
                required={product.modifiers.required}
                maxLength={product.modifiers.text_max_length}
            />

            <br></br>
        </form>
    );
};

export default ProductItem;
